import React from "react";

const AllQuotes = () => {
  return <div>
    <h1>All Quotes</h1>
    <ul>
      <li>Apple</li>
      <li>Doctor</li>
      <li>Something</li>
    </ul>
  </div>;
};

export default AllQuotes;
